import React from 'react';
import './Header.css';

const Header = () => {
    return(
        <div className="series-header">
            <div className="series-content">
                <img className="series-logo" src="../assets/logo.png" alt="rmdb-logo" />
            </div>
        </div>
    )
}

export default Header;
